import '../App.scss';
import Title from '../components/title'

function Home() {
  return (
    <div className="home-container">

     <section className="top-section-homepage">
         <div className="covid-info dark"> <Title title="Covid-19 Updates" underline="lightblue" text="white" /></div>
         <div className="specializarions light"> <Title title="Specializations" underline="darkblue" text="white" /></div>
         <div className="apply dark"> <Title title="Apply Now" underline="lightblue" text="white" /></div>
         <div className="students light"> <Title title="For Students" underline="darkblue" text="white" /></div>
         <div className="idziennik dark"> <Title title="iDziennik" underline="lightblue" text="white" /></div>
     </section>
    </div>
  );
}

export default Home;
